INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("東山奈央", "ヒヨリ", "A", 0, 100101, "人助けが大好き！　前向き格闘娘", 8, 2, "トゥインクルウィッシュ", "獣人族", 27, 16, "人助け、応援", 44, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("種田梨沙", "ユイ", "O", 0, 100201, "戦闘のサポートが得意な、心優しい少女", 4, 2, "トゥインクルウィッシュ", "ヒューマン", 5, 17, "料理、人間観察", 47, 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("早見沙織", "レイ", "B", 0, 100301, "クールで何事にも真っ直ぐな剣士", 1, 2, "トゥインクルウィッシュ", "魔族", 12, 18, "読書、乗馬、お茶", 46, 163, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
