INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("浅倉杏美", "アカリ", "O", 0, 100601, "甘え上手なみんなの人気者", 11, 7, "悪魔偽王国軍（ディアボロス）", "魔族", 22, 13, "サックス", 42, 150, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("雨宮天", "ミヤコ", "B", 0, 100701, "プリン大好きゴースト娘", 1, 7, "悪魔偽王国軍（ディアボロス）", "魔族", 23, 14, "プリンを食べること", 32, 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("大空直美", "ユキ", "AB", 0, 100801, "ボクは誰よりも美しい", 10, 15, "ヴァイスフリューゲル　ランドソル支部", "エルフ", 10, 14, "鏡で自分を見ること", 40, 150, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("髙野麻美", "アンナ", "A", 0, 100901, "前世を信じる中二病患者、「疾風の冥姫」", 7, 13, "トワイライトキャラバン", "魔族", 5, 17, "小説執筆", 45, 159, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("内田真礼", "マホ", "O", 0, 101001, "マホマホ王国のプリンセス", 9, 10, "自警団（カォン）", "獣人族", 22, 16, "空想、ぬいぐるみ集め", 42, 155, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("阿澄佳奈", "リノ", "A", 0, 101101, "人懐っこくてマシンガントークな妹系少女", 8, 3, "ラビリンス", "ヒューマン", 25, 15, "お裁縫", 44, 156, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("大橋彩香", "ハツネ", "A", 0, 101201, "みんなのために超能力を使う眠り姫", 12, 6, "フォレスティエ", "エルフ", 24, 17, "妹と遊ぶこと、二度寝、昼寝、早寝", 46, 156, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！");
