INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("上坂すみれ", "スズナ", "O", 0, 101601, "天真爛漫で人気者のカリスマモデル", 4, 14, "ルーセント学院", "魔族", 10, 18, "ファッション", 48, 167, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！");
