INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("伊藤静", "イオ", "B", 0, 101801, "多くの男性を魅了する無垢な女教師", 8, 14, "ルーセント学院", "魔族", 14, 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, 162, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("日高里菜", "ミミ", "O", 0, 102001, "お歌もにんじんも、ウサギさんも大好き♪", 4, 5, "リトルリリカル", "獣人族", 3, 10, "かわいいもの集め", 21, 117, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("植田佳奈", "クルミ", "B", 0, 102101, "泣き虫で臆病な守ってあげたい女の子", 6, 9, "サレンディア救護院", "ヒューマン", 9, 12, "観劇、おままごと", 40, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
