INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("松嵜麗", "アキノ", "AB", 0, 103201, "一人前の商人を目指すパワフルお嬢様", 3, 12, "メルクリウス財団", "ヒューマン", 12, 18, "慈善事業", 45, 157, "この私とともにいる限り、\nお金に不自由はさせませんわ！");
