INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("田所あずさ", "ミフユ", "O", 0, 104801, "仕事も私事も効率優先な傭兵少女", 11, 12, "メルクリウス財団", "ヒューマン", 11, 20, "傭兵などのアルバイト", 49, 163, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("生天目仁美", "シズル", "O", 0, 104901, "お姉ちゃんがお世話してあげるからねっ！", 10, 3, "ラビリンス", "ヒューマン", 24, 18, "家事全般", 54, 168, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
