INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("辻あゆみ", "モニカ", "A", 0, 105301, "見た目も中身もお子ちゃまな異国の軍人", 7, 15, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", 28, 18, "お菓子屋通い", 33, 140, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！");
