INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("田所あずさ", "ミフユ（サマー）", "O", 0, 108001, "仕事も私事も効率優先な傭兵少女", 11, 12, "メルクリウス財団", "ヒューマン", 11, 20, "傭兵などのアルバイト", 49, 163, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("大坪由佳", "シノブ（ハロウィン）", "AB", 0, 108101, "占いが得意な霊能少女", 12, 7, "悪魔偽王国軍（ディアボロス）", "魔族", 22, 18, "占い", 42, 157, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("雨宮天", "ミヤコ（ハロウィン）", "B", 0, 108201, "プリン大好きゴースト娘", 1, 7, "悪魔偽王国軍（ディアボロス）", "魔族", 23, 14, "プリンを食べること", 32, 130, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("久野美咲", "ミサキ（ハロウィン）", "A", 0, 108301, "ちょっとおませな恋に恋する女の子", 1, 14, "ルーセント学院", "魔族", 3, 11, "ファッション誌鑑賞、コスメ集め", 22, 120, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("福原綾香", "チカ（クリスマス）", "O", 0, 108401, "人々を守るために歌う、唱喚士の少女", 6, 4, "カルミナ", "ヒューマン", 3, 17, "各種楽器", 46, 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("植田佳奈", "クルミ（クリスマス）", "B", 0, 108501, "泣き虫で臆病な守ってあげたい女の子", 6, 9, "サレンディア救護院", "ヒューマン", 9, 12, "観劇、おままごと", 40, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("芹澤優", "アヤネ（クリスマス）", "B", 0, 108601, "ぷうきちといつも一緒！", 5, 9, "サレンディア救護院", "ヒューマン", 10, 14, "屋内でできる遊び", 38, 148, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("東山奈央", "ヒヨリ（ニューイヤー）", "A", 0, 108701, "人助けが大好き！　前向き格闘娘", 8, 2, "トゥインクルウィッシュ", "獣人族", 27, 16, "人助け、応援", 44, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("種田梨沙", "ユイ（ニューイヤー）", "O", 0, 108801, "戦闘のサポートが得意な、心優しい少女", 4, 2, "トゥインクルウィッシュ", "ヒューマン", 5, 17, "料理、人間観察", 47, 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
