INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("橋本ちなみ", "エリコ（バレンタイン）", "B", 0, 109001, "運命の相手に一途すぎる乙女", 7, 13, "トワイライトキャラバン", "魔族", 30, 16, "実験、裁縫、料理", 43, 154, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
